description:
The Elder boys return to Clearwater, Texas for their Mother&amp;#039;s funeral. John the eldest is a well known gunfighter and trouble follows him wherever he goes. The boys try to get back their ranch from the towns gunsmith who won it from their father in a card game with which he was shortly murdered there after but not before getting through the troubles that come with the Elders name



